function tab(className){
    var cid = "."+className,cNav = cid + " > .tab_nav",cCont = cid + " > .tab_cont";
    $(cNav).children().hover(function(){
        var thisIndex = $(cNav).children().index(this);
        $(this).addClass("cur").siblings().removeClass("cur");
        $(cCont).eq(thisIndex).show().siblings(".tab_cont").hide();
    });
}
$(function () {
    $("label").css("background", "#ffcc99");

    $("input[type='radio']").click(function () {
        //$("label").css("background", "#ffcc99").css("color", "#000");
        $(this).parent().parent().find("label").css("background", "#ffcc99").css("color", "#000");
        $(this).parent().css("background", "#FE9C04").css("color", "#fff");
    });
    $("input[type='checkbox']").click(function () {
        if ($(this).attr('checked') == "checked") {
            $(this).parent().css("background", "#FE9C04").css("color", "#fff");
        }
        else {
            $(this).parent().css("background", "#ffcc99").css("color", "#000");
        }
    });
});

